USE [JMS];

-- =============================================================
-- Create procedure 
-- Generate first 10000 FCA's
-- e.g. 
-- Region 1 will have FCA 10001 to 19999
-- Region 2 will have FCA 20001 to 29999
-- =============================================================
IF EXISTS (SELECT name 
       FROM   sysobjects 
       WHERE  name = N'sp_init_fca' 
       AND    type = 'P')
    DROP PROCEDURE sp_init_fca
GO

CREATE PROCEDURE sp_init_fca
    @region_id int
AS
    DECLARE @fca_no int
    SET @fca_no = @region_id * 10000 + 1

    DECLARE @count int
    SET @count = 0

    WHILE (@count < 9999)
    BEGIN
        DECLARE @subpanel int
        SET @subpanel = 1

        WHILE (@subpanel < 10)
        BEGIN
            DECLARE @fca_no_subpanel varchar(8)
            if (@subpanel < 10)
                SET @fca_no_subpanel = CAST(@fca_no AS varchar(5)) + '-0' + CAST(@subpanel AS varchar(1))
            else
                SET @fca_no_subpanel = CAST(@fca_no AS varchar(5)) + '-' + CAST(@subpanel AS varchar(2))

            DECLARE @sub_panel char(1)
            if (@subpanel = 1)
                SET @sub_panel = 'N'
            else
                SET @sub_panel = 'Y'

            if not exists (SELECT * FROM FCA WHERE FCA_NO = @fca_no_subpanel)
                INSERT INTO FCA (FCA_NO, FILE_ID, REGION_ID, SUB_PANEL) VALUES (@fca_no_subpanel, NULL, @region_id, @sub_panel)

            SET @subpanel = @subpanel + 1
        END

        SET @count = @count + 1
        SET @fca_no = @fca_no + 1
    END
GO

