       AND    type = 'P')
    DROP PROCEDURE sp_create_area
GO

CREATE PROCEDURE sp_create_area
    @area_id varchar(10),
    @area_name varchar(255),
    @region_name varchar(100)
AS
    DECLARE @region_id int
    SELECT @region_id = REGION_ID FROM REGION WHERE NAME = @region_name

    INSERT INTO CONTACT (SALUTATION, FIRST_NAME, SURNAME) VALUES ('-', 'TBD', 'TBD')
    DECLARE @contact_id int
    SET @contact_id = @@IDENTITY

    INSERT INTO ADDRESS (ADDR_LINE_1, SUBURB, POSTCODE, STATE) VALUES ('TBD', 'TBD', '4000', 'QLD')
    DECLARE @address_id int
    SET @address_id = @@IDENTITY

    INSERT INTO AREA (AREA_ID,NAME,REGION_ID,CONTACT_ID,ADDRESS_ID) VALUES (@area_id,@area_name,@region_id,@contact_id,@address_id);
GO

