GO

CREATE PROCEDURE sp_create_station
    @station_code varchar(10),
    @station_name varchar(255),
    @area_id varchar(10),
    @phone varchar(50) = NULL,
    @mobile varchar(50) = NULL,
    @fax varchar(50) = NULL,
    @address_line varchar(255) = 'TBD',
    @suburb varchar(255) = 'TBD',
    @state varchar(3) = 'QLD',
    @postcode varchar(10) = '4000'
AS
    INSERT INTO CONTACT (SALUTATION, FIRST_NAME, SURNAME,PHONE,MOBILE,FAX) VALUES ('-', 'TBD', 'TBD',@phone,@mobile,@fax)
    DECLARE @contact_id int
    SET @contact_id = @@IDENTITY

    INSERT INTO ADDRESS (ADDR_LINE_1, SUBURB, POSTCODE, STATE) VALUES (@address_line,@suburb,@postcode,@state)
    DECLARE @address_id int
    SET @address_id = @@IDENTITY

    INSERT INTO STATION (STATION_CODE,NAME,AREA_ID,CONTACT_ID,ADDRESS_ID) VALUES (@station_code,@station_name,@area_id,@contact_id,@address_id);
GO

