IF EXISTS (SELECT name 
       FROM   sysobjects 
       WHERE  name = N'sp_update_fca' 
       AND    type = 'P')
    DROP PROCEDURE sp_update_fca
GO

CREATE PROCEDURE sp_update_fca
    @fca_no varchar(8),
    @station_code varchar(10)
AS
    DECLARE @area_id varchar(10)
    SELECT @area_id = AREA_ID FROM STATION WHERE STATION_CODE = @station_code

    DECLARE @region_id int
    SELECT @region_id = REGION_ID FROM AREA WHERE AREA_ID = @area_id

    UPDATE FCA SET REGION_ID = @region_id, AREA_ID = @area_id, STATION_CODE = @station_code WHERE FCA_NO = @fca_no
GO

