CREATE PROCEDURE sp_create_supplier
    @supplier_type varchar(100),
    @supplier_name varchar(255),
    @supplier_legal_name varchar(255),
    @supplier_abn varchar(11),
    @region_name varchar(255),
    @address_line1 varchar(255),
    @address_line2 varchar(255),
    @suburb varchar(255),
    @state varchar(3),
    @postcode varchar(10),
    @postal_address_line1 varchar(255),
    @postal_address_line2 varchar(255),
    @postal_suburb varchar(255),
    @postal_state varchar(3),
    @postal_postcode varchar(10),
    @salutation varchar(50),
    @first_name varchar(255),
    @surname varchar(255),
    @email varchar(50),
    @phone varchar(50),
    @fax varchar(50),
    @mobile varchar(50)
AS
    DECLARE @supplier_type_id int
    SELECT @supplier_type_id = SUPPLIER_TYPE_ID FROM SUPPLIER_TYPE WHERE NAME = @supplier_type

    DECLARE @region_id int
    SELECT @region_id = REGION_ID FROM REGION WHERE NAME = @region_name

    INSERT INTO CONTACT (SALUTATION, FIRST_NAME, SURNAME,PHONE,MOBILE,FAX) VALUES ('-', 'TBD', 'TBD',@phone,@mobile,@fax)
    DECLARE @contact_id int
    SET @contact_id = @@IDENTITY

    INSERT INTO ADDRESS (ADDR_LINE_1,ADDR_LINE_2,SUBURB,POSTCODE,STATE) VALUES (@address_line1,@address_line2,@suburb,@postcode,@state)
    DECLARE @address_id int
    SET @address_id = @@IDENTITY

    INSERT INTO ADDRESS (ADDR_LINE_1,ADDR_LINE_2,SUBURB,POSTCODE,STATE) VALUES (@postal_address_line1,@postal_address_line2,@postal_suburb,@postal_postcode,@postal_state)
    DECLARE @postal_address_id int
    SET @postal_address_id = @@IDENTITY

    INSERT INTO SUPPLIER (SUPPLIER_TYPE_ID,NAME,LEGAL_NAME,ABN,REGION_ID,CONTACT_ID,ADDRESS_ID,POST_ADDRESS_ID) VALUES (@supplier_type_id,@supplier_name,@supplier_legal_name,@supplier_abn,@region_id,@contact_id,@address_id,@postal_address_id);
GO

