-- =============================================================
-- Create procedure (set identity to start with 10001)
-- =============================================================
IF EXISTS (SELECT name 
       FROM   sysobjects 
       WHERE  name = N'sp_create_file' 
       AND       type = 'P')
    DROP PROCEDURE sp_create_file
GO

CREATE PROCEDURE sp_create_file
    @fca_no varchar(8),
    @building_name varchar(100),
    @addr_line_1 varchar(255),
    @suburb varchar(255),
    @postcode varchar(10),
    @state varchar(3)
AS
    INSERT INTO FILES (FILE_STATUS_ID) VALUES (1)
    DECLARE @file_id int
    SET @file_id = @@IDENTITY
    DECLARE @region_id int
    SET @region_id = SUBSTRING(@fca_no, 1, 1)

    if not exists (SELECT * FROM FCA WHERE FCA_NO = @fca_no)
        INSERT INTO FCA (FCA_NO, FILE_ID, REGION_ID) VALUES (@fca_no, @file_id, @region_id)

    INSERT INTO ADDRESS (ADDR_LINE_1, SUBURB, POSTCODE, STATE) VALUES (@addr_line_1, @suburb, @postcode, @state)
    DECLARE @address_id int
    SET @address_id = @@IDENTITY
    INSERT INTO BUILDING (NAME, FILE_ID, ADDRESS_ID) VALUES (@building_name, @file_id, @address_id)
GO

