CREATE PROCEDURE sp_create_file_owner_sap
    @fca_no varchar(8),
    @sap_cust_no varchar(11),
	@legal_name varchar(255),
    @addr_line_1 varchar(255),
    @suburb varchar(255),
    @postcode varchar(10),
    @state varchar(3),
	@surname varchar(255),
    @phone varchar(50),
    @mobile varchar(50),
    @fax varchar(50),
	@comments varchar(255)
AS
    DECLARE @file_id int
    SELECT @file_id = FILE_ID FROM FCA WHERE FCA_NO = @fca_no

    IF @file_id > 0
    BEGIN
        INSERT INTO CONTACT (SALUTATION, FIRST_NAME, SURNAME, PHONE, MOBILE, FAX) VALUES ('-', @comments, @surname, @phone, @mobile, @fax)
        DECLARE @contact_id int
        SET @contact_id = @@IDENTITY

        INSERT INTO ADDRESS (ADDR_LINE_1, SUBURB, POSTCODE, STATE) VALUES (@addr_line_1, @suburb, @postcode, @state)
        DECLARE @address_id int
        SET @address_id = @@IDENTITY

        INSERT INTO OWNER (LEGAL_NAME, FILE_ID, CONTACT_ID, ADDRESS_ID) VALUES (@legal_name, @file_id, @contact_id, @address_id)

        INSERT INTO SAP_HEADER (FILE_ID, SAP_CUST_NO) VALUES (@file_id, @sap_cust_no)
    END
GO

